uploadtext:
Käytä tädä formua tiijoston tallendamizekse. Ku tahtonet kaččuo libo löydiä ennepäi tallendettuloi tiijostoloi, kačo [[Special:FileList|tallendettuloin tiijostoloin luvetteluu]]. Tallenduksii da uvvellehtallenduksii sežo registriiruijah [[Special:Log/upload|tallenduksien žurnualas]]. Tieduo iäreotettulois tiijostolois voibi löydiä [[Special:Log/delete|iäreottamizien žurnualas]].

Ku tahtonet liittiä tiijoston tekstah, käytä linkua moizis formuatois: 
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code></strong> tiijoston tävvellizen versien käyttämizekse;
** <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|Caption]]</nowiki></code></strong> kuvan tekstaspäi huruale panemizeh niškoi levevyönke 200 pikselii da kuvuamizenke sen al;
* <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></code></strong> tiijoston kohtinazeh käyttöh niškoi, ozuttamattah sen syväindyö.

